INSERT INTO `news` (`id`, `title`, `description`, `hot`, `image`, `content`, `alias`, `lang`, `tag`, `time_update`, `time`, `category_id`, `home`, `focus`, `title_seo`, `keyword_seo`, `description_seo`, `video`, `view`, `active`, `button_1`, `sort`) VALUES ('1', 'Xu hướng thiết kế nội thât biệt thự hiện đại cao cấp', '<p>Ng&agrave;y nay với sự ph&aacute;t triển x&atilde; hội &nbsp;lớn mạnh, nhu cầu về vật chất cũng dần được n&acirc;ng cao. V&igrave; vậy m&agrave;, nhu cầu về nh&agrave; ở của mọi người cũng trở n&ecirc;n hiện đại. Đặc biệt hơn, với xu hướng x&acirc;y dựng c&aacute;c kiến tr&uacute;c hiện nay độc đ&aacute;o thiết kế biệt thự đang được xem &nbsp;l&agrave; xu hướng x&acirc;y dựng của rất nhiều người.&nbsp;</p>\r\n', NULL, 'upload/img/news/a9.jpg', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">Ng&agrave;y nay với sự ph&aacute;t triển x&atilde; hội &nbsp;lớn mạnh, nhu cầu về vật chất cũng dần được n&acirc;ng cao. V&igrave; vậy m&agrave;, nhu cầu về nh&agrave; ở của mọi người cũng trở n&ecirc;n hiện đại. Đặc biệt hơn, với xu hướng x&acirc;y dựng c&aacute;c kiến tr&uacute;c hiện nay độc đ&aacute;o thiết kế biệt thự đang được xem &nbsp;l&agrave; xu hướng x&acirc;y dựng của rất nhiều người.&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Với kinh nghiệm l&acirc;u năm trong lĩnh vực thiết kế nội thất biệt thự, Morehome lu&ocirc;n t&igrave;m kiếm v&agrave; đưa ra &yacute; tưởng xu hướng trong &nbsp;thiết kế biệt thự phong c&aacute;ch hiện đại. Thiết kế biệt thự hiện đại thể hiện được sự đẳng cấp của gia chủ c&oacute; n&eacute;t độc đ&aacute;o trong kiến tr&uacute;c kh&ocirc;ng thể thấy ở những mẫu thiết kế kh&aacute;c.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Kh&ocirc;ng những với c&oacute; diện t&iacute;ch kh&ocirc;ng gian rộng lớn, m&agrave; thiết kế biệt thự hiện đại c&ograve;n mang một phong c&aacute;ch thiết kế rất tinh tế độc đ&aacute;o, trong đ&oacute; c&oacute; sự kết hợp rất h&agrave;i h&ograve;a c&aacute;c giữa đường n&eacute;t, họa tiết nội thất rất tinh tế, từ trang nghi&ecirc;m đến lộng lẫy sang trọng. Gia chủ &nbsp;sẽ kh&ocirc;ng c&ograve;n kh&oacute; khăn g&igrave; trong việc chọn cho mẫu thiết kế biệt thự.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Thiết kế biệt thự hiện đại 2 tầng.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Xu hướng thiết kế biệt thự 2 tầng đang được xem l&agrave; xu hướng được lựa chọn nhiều hiện nay. Thiết kế biệt thự 2 tầng tuy kh&ocirc;ng lộng lẫy nhưng &nbsp;thiết kế n&agrave;y lại &nbsp;to&aacute;t l&ecirc;n một vẻ đẹp phương Đ&ocirc;ng. Song song đ&oacute; ch&iacute;nh l&agrave; sự &nbsp;mới lạ nhưng vẫn giữ được n&eacute;t truyền thống, vừa l&agrave; sự kết hợp n&eacute;t mới mẻ k&egrave;m với phong c&aacute;ch kiến tr&uacute;c hiện đại l&agrave;m n&ecirc;n &nbsp;một ng&ocirc;i biệt thự đẹp tinh tế. B&ecirc;n cạnh đ&oacute;, thiết kế biệt thự thể hiện sự th&acirc;n thiện gần gũi.</span></p>\r\n', 'xu-huong-thiet-ke-noi-that-biet-thu-hien-dai-cao-cap', 'vi', NULL, NULL, '1521256798', '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0');
INSERT INTO `news` (`id`, `title`, `description`, `hot`, `image`, `content`, `alias`, `lang`, `tag`, `time_update`, `time`, `category_id`, `home`, `focus`, `title_seo`, `keyword_seo`, `description_seo`, `video`, `view`, `active`, `button_1`, `sort`) VALUES ('2', 'Trang trí không gian nội thất biệt thự nhà phố', '<p>Thiết kế nội thất nh&agrave; phố đang l&agrave; chọn lựa cua nhiều gia đ&igrave;nh sinh sống tại c&aacute;c th&agrave;nh phố, vậy l&agrave;m sao c&oacute; thể trang tr&iacute; nội thất nh&agrave; phố một c&aacute;ch ph&ugrave; hợp v&agrave; h&agrave;i h&ograve;a nhất. Bạn h&atilde;y tham khảo b&agrave;i viết sau để c&oacute; thể chọn lựa &yacute; tưởng cho thiết kế nội thất nh&agrave; phố nh&eacute;!.</p>\r\n', NULL, 'upload/img/news/a10.jpg', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">Thiết kế nội thất nh&agrave; phố đang l&agrave; chọn lựa cua nhiều gia đ&igrave;nh sinh sống tại c&aacute;c th&agrave;nh phố, vậy l&agrave;m sao c&oacute; thể trang tr&iacute; nội thất nh&agrave; phố một c&aacute;ch ph&ugrave; hợp v&agrave; h&agrave;i h&ograve;a nhất. Bạn h&atilde;y tham khảo b&agrave;i viết sau để c&oacute; thể chọn lựa &yacute; tưởng cho thiết kế nội thất nh&agrave; phố nh&eacute;!.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Thiết kế nội thất nh&agrave; phố phong c&aacute;ch hiện đại<br />\r\nKhi x&acirc;y dựng một thiết kế biệt thự nh&agrave; phố th&igrave; cần phải tu&acirc;n thủ theo một số quy chuẩn v&igrave; t&iacute;nh chất đặc trưng ri&ecirc;ng biệt của phong c&aacute;ch thiết kế n&agrave;y do c&oacute; diện t&iacute;ch hạn chế v&agrave; &iacute;t mặt tho&aacute;ng hơn.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Trang tr&iacute; kh&ocirc;ng gian nội thất biệt thự nh&agrave; phố</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Kh&ocirc;ng gian ph&ograve;ng kh&aacute;ch hiện đại cao cấp.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Trong kh&ocirc;ng gian của ph&ograve;ng kh&aacute;ch<br />\r\nPh&ograve;ng kh&aacute;ch sẽ thật ho&agrave;n hảo nếu bạn biết c&aacute;ch chọn nội thất cũng như m&agrave;u sắc cho kh&ocirc;ng gian tạo hiệu ứng mở rộng, d&ugrave;ng gam m&agrave;u trắng v&agrave; m&agrave;u n&acirc;u nhẹ nh&agrave;ng sẽ l&agrave;m hiệu ứng mở rộng kh&ocirc;ng gian.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Bạn c&oacute; thể chọn một bộ ghế sofa c&oacute; m&agrave;u đen kết hợp h&agrave;i h&ograve;a với những mảng tường mộc tuy đơn giản nhưng vẫn to&aacute;t l&ecirc;n vẻ đẹp hiện đại cho ph&ograve;ng kh&aacute;ch m&agrave; kh&ocirc;ng cần phải cầu kỳ. B&ecirc;n cạnh đ&oacute; bạn c&oacute; thể d&ugrave;ng chậu c&acirc;y, bức tranh nghệ thuật hoặc gương trang tr&iacute; cho kh&ocirc;ng gian th&ecirc;m phần sinh động hơn.</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:14px\">Kh&ocirc;ng gian của nh&agrave; bếp<br />\r\nĐược x&acirc;y dựng &nbsp;với gam m&agrave;u trắng chủ đạo bộ b&agrave;n ghế với chất liệu gỗ tự nhi&ecirc;n đ&atilde; l&agrave;m một điểm nhấn độc đ&aacute;o cho kh&ocirc;ng gian, ph&ograve;ng bếp h&igrave;nh chữ L kh&aacute; đơn giản l&agrave;m s&aacute;ng kh&ocirc;ng gian, thiết kế nội thất ph&ograve;ng bếp rất tiện dụng với c&aacute;c vật dụng được b&agrave;i tr&iacute; rất tiện nghi.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Trang tr&iacute; kh&ocirc;ng gian nội thất biệt thự nh&agrave; phố</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Ph&ograve;ng bếp với thiết kế hiện đại.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Điểm nhấn đẹp mắt cho kh&ocirc;ng gian đ&oacute; ch&iacute;nh l&agrave; b&oacute;ng đ&egrave;n m&agrave;u v&agrave;ng trang tr&iacute; trong ph&ograve;ng ăn tạo n&ecirc;n một sự ấm &aacute;p cho kh&ocirc;ng gian th&ecirc;m đẹp mắt hơn.</span></p>\r\n', 'trang-tri-khong-gian-noi-that-biet-thu-nha-pho', 'vi', NULL, NULL, '1521256855', '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0');
INSERT INTO `news` (`id`, `title`, `description`, `hot`, `image`, `content`, `alias`, `lang`, `tag`, `time_update`, `time`, `category_id`, `home`, `focus`, `title_seo`, `keyword_seo`, `description_seo`, `video`, `view`, `active`, `button_1`, `sort`) VALUES ('3', 'Trang trí nội thất cho không gian nhà ấn tượng', '<p>Cho d&ugrave; kh&ocirc;ng gian nh&agrave; bạn được thiết kế nội thất theo phong c&aacute;ch n&agrave;o th&igrave; cũng cần tạo n&ecirc;n sự ấn tượng để c&oacute; thể thu h&uacute;t c&aacute;c vị kh&aacute;ch khi bước v&agrave;o kh&ocirc;ng gian nh&agrave;. &nbsp;Để tạo được điểm nhấn cho kh&ocirc;ng gian th&igrave; bạn cần phải t&igrave;m hiểu tham khảo thật kỹ c&agrave;ng, khẳng định n&eacute;t độc đ&aacute;o ri&ecirc;ng biệt của kh&ocirc;ng gian nh&agrave; bạn so với những kh&ocirc;ng gian kh&aacute;c. H&atilde;y tham khảo những &yacute; tưởng sau đ&acirc;y về thiết kế nội thất cho kh&ocirc;ng gian thật sự độc đ&aacute;o v&agrave; đẳng cấp.</p>\r\n', NULL, 'upload/img/news/trang-tri-noi-that-cho-khong-gian-nha-an-tuong-3.jpeg', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">Cho d&ugrave; kh&ocirc;ng gian nh&agrave; bạn được thiết kế nội thất theo phong c&aacute;ch n&agrave;o th&igrave; cũng cần tạo n&ecirc;n sự ấn tượng để c&oacute; thể thu h&uacute;t c&aacute;c vị kh&aacute;ch khi bước v&agrave;o kh&ocirc;ng gian nh&agrave;. &nbsp;Để tạo được điểm nhấn cho kh&ocirc;ng gian th&igrave; bạn cần phải t&igrave;m hiểu tham khảo thật kỹ c&agrave;ng, khẳng định n&eacute;t độc đ&aacute;o ri&ecirc;ng biệt của kh&ocirc;ng gian nh&agrave; bạn so với những kh&ocirc;ng gian kh&aacute;c. H&atilde;y tham khảo những &yacute; tưởng sau đ&acirc;y về thiết kế nội thất cho kh&ocirc;ng gian thật sự độc đ&aacute;o v&agrave; đẳng cấp.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Thiết kế nội thất ph&ograve;ng kh&aacute;ch<br />\r\nNếu l&agrave; kh&ocirc;ng gian của ph&ograve;ng kh&aacute;ch th&igrave; kh&aacute; l&agrave; thuận lợi trong việc tạo điểm nhấn, để thể hiện đẳng cấp của bạn trong thiết kế nội thất ph&ograve;ng kh&aacute;ch th&ecirc;m sang trọng thấy được gu thẩm mỹ cũng như t&iacute;nh ri&ecirc;ng biệt của gia chủ trong kh&ocirc;ng gian n&agrave;y, bằng những nội thất th&acirc;n thuộc như bộ ghế sofa, điểm v&agrave;o những chiếc gối c&oacute; họa tiết độc đ&aacute;o hoặc gắn v&agrave;o một bức tranh treo tường để tăng sự thu h&uacute;t cho nơi n&agrave;y, kh&ocirc;ng gian ph&ograve;ng kh&aacute;ch l&agrave; một nơi kh&aacute; quan trọng, trong việc thiết kế nội thất cần phải chọn lựa thật cẩn thận c&aacute;c chi tiết, nội thất phải được kết hợp h&agrave;i h&ograve;a. Ngo&agrave;i ra c&ograve;n phải được x&acirc;y dựng tạo n&ecirc;n bầu kh&ocirc;ng kh&iacute; thật tho&aacute;ng m&aacute;t.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Trang tr&iacute; nội thất cho kh&ocirc;ng gian nh&agrave; ấn tượng</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Ph&ograve;ng kh&aacute;ch nổi bật với bộ ghế đầy ấn tượng.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Kh&ocirc;ng gian của ph&ograve;ng ngủ<br />\r\nĐối với kh&ocirc;ng gian n&agrave;y th&igrave; việc trang tr&iacute; nội thất cũng trở n&ecirc;n đơn giản với c&aacute;ch b&agrave;y tr&iacute; gọn g&agrave;ng v&agrave; &iacute;t đồ. Ch&iacute;nh v&igrave; thế m&agrave; tạo điểm nhấn hiệu quả cho kh&ocirc;ng gian n&agrave;y bạn c&oacute; thể b&agrave;y tr&iacute; v&agrave;o một g&oacute;c nhỏ của giường ngủ v&agrave; m&agrave;u sắc bạn h&atilde;y chọn đ&uacute;ng h&igrave;nh d&aacute;ng v&agrave; cũng như chất liệu của chiếc giường v&agrave; kh&ocirc;ng qu&ecirc;n chọn lựa m&agrave;u sắc cho bộ chăn ga trải giường thật ấn tượng. B&ecirc;n cạnh đ&oacute;, h&atilde;y chọn một bức tranh đặt tr&ecirc;n đ&acirc;u giường với họa tiết bắt mắt v&agrave; độc đ&aacute;o.</span></p>\r\n', 'trang-tri-noi-that-cho-khong-gian-nha-an-tuong', 'vi', NULL, NULL, '1521256919', '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0');
INSERT INTO `news` (`id`, `title`, `description`, `hot`, `image`, `content`, `alias`, `lang`, `tag`, `time_update`, `time`, `category_id`, `home`, `focus`, `title_seo`, `keyword_seo`, `description_seo`, `video`, `view`, `active`, `button_1`, `sort`) VALUES ('4', 'Thiết kế nội thất biệt thự Hà Đô phong cách tân cổ điển', '<p>Mẫu thiết kế nội thất biệt thự t&acirc;n cổ điển nhấn mạnh v&agrave;o sự sang trọng v&agrave; cao cấp của kh&ocirc;ng gian nội thất nhằm mang đến một kh&ocirc;ng gian sống đẹp, trang nh&atilde; v&agrave; h&agrave;i h&ograve;a.</p>\r\n\r\n<p>M&agrave;u sắc trang nh&atilde; trong thiết kế nội thất<br />\r\nNhững gam m&agrave;u tang nh&atilde; được lựa chọn v&agrave; sử dụng trong mẫu thiết kế biệt thự cao cấp n&agrave;y. M&agrave;u trung t&iacute;nh như trắng, x&aacute;m nhạt, n&acirc;u v&agrave; v&agrave;ng được sử dụng trong kh&ocirc;ng gian thiết kế nhằm nhắn mạnh sự sang trọng v&agrave; cổ điển cua kh&ocirc;ng gian nội thất. M&agrave;u trắng được chọn l&agrave;m m&agrave;u nền, được sử dụng để trang tr&iacute; cho những bức tường, trần v&agrave; tủ kệ trong ph&ograve;ng kh&aacute;ch. M&agrave;u v&agrave;ng &nbsp;v&agrave; n&acirc;u chủ yếu được sử dụng để tạo điểm nhấn như d&ugrave;ng l&agrave;m m&agrave;u cho vật dụng nội thất hay l&agrave; m&agrave;u viền trang tr&iacute; cho gạch ốp s&agrave;n.</p>\r\n', NULL, 'upload/img/news/a11.jpg', '', 'thiet-ke-noi-that-biet-thu-ha-do-phong-cach-tan-co-dien', 'vi', NULL, NULL, '1521257057', '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0');
INSERT INTO `news` (`id`, `title`, `description`, `hot`, `image`, `content`, `alias`, `lang`, `tag`, `time_update`, `time`, `category_id`, `home`, `focus`, `title_seo`, `keyword_seo`, `description_seo`, `video`, `view`, `active`, `button_1`, `sort`) VALUES ('5', 'Mẫu thiết kế biệt thự đẹp 2018 phong cách hiện đại sang trọng', '<p>Phong c&aacute;ch hiện đại l&agrave; xu hướng thiết kế hiện nay, được ứng dụng v&agrave;o những mẫu thiết kế biệt thự đẹp 2018 nhằm mang đến cho gia chủ một kh&ocirc;ng gian sống hiện đại v&agrave; sang trọng. Phong c&aacute;ch hiện đại nổi l&ecirc;n như l&agrave; một trong những lựa chọn h&agrave;ng đầu để thiết kế biệt thự đẹp. Kh&ocirc;ng giống với biệt thự cổ điển, những mẫu thiết kế biệt thự đẹp 2018 phong c&aacute;ch hiện đại c&oacute; chi tiết, dường n&eacute;t thiết kế nội thất kh&aacute; đơn giản, tinh tế v&agrave; kh&ocirc;ng k&eacute;m phần thu h&uacute;t, sang trọng. Đ&acirc;y l&agrave; phong c&aacute;ch thiết kế nhằm mang đến cho kh&ocirc;ng gian nội thất sự tinh tế v&agrave; thanh lịch.</p>\r\n', NULL, 'upload/img/news/mau-thiet-ke-biet-thu-dep-2018-phong-cach-hien-dai-sang-trong-1.jpeg', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">Phong c&aacute;ch hiện đại l&agrave; xu hướng thiết kế hiện nay, được ứng dụng v&agrave;o những mẫu thiết kế biệt thự đẹp 2018 nhằm mang đến cho gia chủ một kh&ocirc;ng gian sống hiện đại v&agrave; sang trọng. Phong c&aacute;ch hiện đại nổi l&ecirc;n như l&agrave; một trong những lựa chọn h&agrave;ng đầu để thiết kế biệt thự đẹp. Kh&ocirc;ng giống với biệt thự cổ điển, những mẫu thiết kế biệt thự đẹp 2018 phong c&aacute;ch hiện đại c&oacute; chi tiết, dường n&eacute;t thiết kế nội thất kh&aacute; đơn giản, tinh tế v&agrave; kh&ocirc;ng k&eacute;m phần thu h&uacute;t, sang trọng. Đ&acirc;y l&agrave; phong c&aacute;ch thiết kế nhằm mang đến cho kh&ocirc;ng gian nội thất sự tinh tế v&agrave; thanh lịch.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Đường n&eacute;t đơn giản nhưng sang trọng<br />\r\nMẫu biệt thự đẹp 2018 phong c&aacute;ch hiện đại kh&ocirc;ng qu&aacute; cầu k&igrave;, phức tạp nhưng lại v&ocirc; c&ugrave;ng tinh tế, sang trọng. đ&oacute; l&agrave; những đường n&eacute;t, những mảng, những h&igrave;nh khối được sắp xếp h&agrave;i h&ograve;a, ấn tượng trong kh&ocirc;ng gian sống. Đ&oacute; cũng l&agrave; sự tương phản độc đ&aacute;o tạo ấn tượng mạnh mẽ cho kh&ocirc;ng gian như đường thẳng sắc cạnh được đặt b&ecirc;n đường cong mềm mại, vật dụng lớn đặt cạnh vật dụng b&eacute;. Ch&uacute;ng tạo n&ecirc;n một kh&ocirc;ng gian vừa h&agrave;i h&ograve;a, vừa th&uacute; vị.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Mẫu thiết kế biệt thự đẹp 2018 phong c&aacute;ch hiện đại sang trọng</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Kh&ocirc;ng gian sang trọng m&agrave;u sắc nổi bật.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">M&agrave;u sắc thanh lịch</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Thay v&igrave; sử dụng những m&agrave;u trầm như biệt thự cổ điển mẫu biệt thự đẹp 2018 phong c&aacute;ch hiện đại n&agrave;y ứng dụng những m&agrave;u sắc tran g nh&atilde; v&agrave; tinh tế. m&agrave;u trắng ng&agrave; được sử dụng để trang tr&iacute; bức tường. M&agrave;u trắng mang đến cảm gi&aacute;c sang trọng, tinh tế v&agrave; cũng khiến cho kh&ocirc;ng gian nội thất trở n&ecirc;n s&aacute;ng sủa hơn. Tr&ecirc;n những bức tường l&agrave; họa tiết, h&igrave;nh ảnh hoa l&aacute; c&agrave;nh sang trọng, hiện đại mang đến điểm nhấn độc đ&aacute;o cho thiết kế.</span></p>\r\n', 'mau-thiet-ke-biet-thu-dep-2018-phong-cach-hien-dai-sang-trong', 'vi', NULL, NULL, '1521257165', '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0');
