INSERT INTO `product` (`id`, `style`, `id_value`, `brand`, `name`, `code`, `alias`, `image`, `hot`, `home`, `focus`, `coupon`, `view`, `active`, `price`, `price_sale`, `description`, `description_seo`, `location`, `title_seo`, `keyword_seo`, `detail`, `note`, `like`, `order`, `category_id`, `caption_1`, `caption_2`, `locale`, `bought`, `dksudung`, `sort`, `quantity`, `counter`, `lang`, `destination`, `time`, `tags`, `pro_dir`, `multi_image`, `img_dir`, `status`, `quaranty`, `tinhtrang`, `group_attribute_id`, `color`, `size`, `user_id`, `option_id`, `button_color1`, `config_pro`, `config_pro_content`, `weight`, `price_imp`) VALUES ('2', NULL, NULL, NULL, 'BỘ SOFA A1305 VỚI KỆ ĐỂ ĐỒ TIỆN DỤNG', NULL, 'bo-sofa-a1305-voi-ke-de-do-tien-dung', 'sofa-3-bang-goc-phai-a1305-268x201.jpg', NULL, NULL, NULL, NULL, NULL, '1', NULL, '6774354', '<p>Chi tiết sản phẩm Bộ sofa A1305 với kệ để đồ tiện dụng<br />\r\nT&acirc;m điểm cho nội thất ph&ograve;ng kh&aacute;ch l&agrave; bộ Sofa. Đ&oacute; l&agrave; nơi thể hiện t&iacute;nh c&aacute;ch, gu thẩm mỹ của gia chủ , l&agrave; nơi để tiếp đ&oacute;n c&aacute;c vị kh&aacute;ch qu&yacute; vậy n&ecirc;n khi mua n&ecirc;n lựa chọn tham khảo kỹ c&agrave;ng rồi h&atilde;y mua.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '1', NULL, NULL, NULL, '0', NULL, NULL, '0', '0', 'vi', NULL, NULL, NULL, '17032018', NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, '2', NULL, '0', '[{\"content\":\"<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">Chi ti\\u1ebft s\\u1ea3n ph\\u1ea9m B\\u1ed9 sofa A1305 v\\u1edbi k\\u1ec7 \\u0111\\u1ec3 \\u0111\\u1ed3 ti\\u1ec7n d\\u1ee5ng<br \\/>\\r\\nT&acirc;m \\u0111i\\u1ec3m cho n\\u1ed9i th\\u1ea5t ph&ograve;ng kh&aacute;ch l&agrave; b\\u1ed9 Sofa. \\u0110&oacute; l&agrave; n\\u01a1i th\\u1ec3 hi\\u1ec7n t&iacute;nh c&aacute;ch, gu th\\u1ea9m m\\u1ef9 c\\u1ee7a gia ch\\u1ee7 , l&agrave; n\\u01a1i \\u0111\\u1ec3 ti\\u1ebfp \\u0111&oacute;n c&aacute;c v\\u1ecb kh&aacute;ch qu&yacute; v\\u1eady n&ecirc;n khi mua n&ecirc;n l\\u1ef1a ch\\u1ecdn tham kh\\u1ea3o k\\u1ef9 c&agrave;ng r\\u1ed3i h&atilde;y mua.<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">N\\u1ed9i th\\u1ea5t Gia Kh&aacute;nh gi\\u1edbi thi\\u1ec7u \\u0111\\u1ebfn b\\u1ea1n b\\u1ed9 sofa v\\u1ea3i A1305 v\\u1edbi k\\u1ec7 \\u0111\\u1ec3 \\u0111\\u1ed3 ngay b&ecirc;n d\\u01b0\\u1edbi &nbsp;th&agrave;nh sofa \\u0111em \\u0111\\u1ebfn s\\u1ef1 ti\\u1ec7n d\\u1ee5ng cho b\\u1ea1n v&agrave; nh\\u1eefng v\\u1ecb kh&aacute;ch mang c&aacute;c \\u0111\\u1eb7c t&iacute;nh v\\u01b0\\u1ee3t tr\\u1ed9i:<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">Sofa \\u0111\\u01b0\\u1ee3c nh\\u1eadp kh\\u1ea9u 100% c\\u1ee7a c&aacute;c h&atilde;ng s\\u1ea3n xu\\u1ea5t uy t&iacute;n.<br \\/>\\r\\nCh\\u1ea5t li\\u1ec7u v\\u1ea3i n\\u1ec9, n\\u1ec9 th&ocirc; c&oacute; \\u0111\\u1ed9 b\\u1ec1n t\\u1ed1t, t&iacute;nh th\\u1ea9m m\\u1ef9 cao.<br \\/>\\r\\nKhung g\\u1ed7 ch\\u1eafc ch\\u1eafn \\u0111\\u01b0\\u1ee3c l&agrave;m b\\u1eb1ng g\\u1ed7 t\\u1ef1 nhi&ecirc;n \\u0111&atilde; qua x\\u1eed l&yacute; ch\\u1ed1ng cong v&ecirc;nh m\\u1ed1i m\\u1ecdt.<br \\/>\\r\\nH\\u1ec7 th\\u1ed1ng l&ograve; xo u\\u1ed1n cong v\\u1edbi c&ocirc;ng ngh\\u1ec7 u\\u1ed1n ti&ecirc;n ti\\u1ebfn c\\u1ee7a \\u0110&agrave;i Loan t\\u1ea1o \\u0111\\u1ed9 \\u0111&agrave;n h\\u1ed3i b\\u1ec1 m\\u1eb7t v&agrave; n&acirc;ng cao kh\\u1ea3 n\\u0103ng ch\\u1ecbu l\\u1ef1c cho s\\u1ea3n ph\\u1ea9m.<br \\/>\\r\\nS\\u1eed d\\u1ee5ng c&aacute;c v\\u1eadt li\\u1ec7u b\\u1ecdc m&uacute;t ti&ecirc;u chu\\u1ea9n, b&ocirc;ng nhi\\u1ec7t, b&ocirc;ng t&aacute;n l\\u1ef1c gi&uacute;p cho s\\u1ea3n ph\\u1ea9m c&oacute; \\u0111\\u1ed9 &ecirc;m &aacute;i v&agrave; c&oacute; s\\u1ee9c \\u0111&agrave;n h\\u1ed3i cao.<br \\/>\\r\\nS\\u1ea3n ph\\u1ea9m \\u0111\\u01b0\\u1ee3c b\\u1ea3o h&agrave;nh 5 n\\u0103m v\\u1ec1 khung x\\u01b0\\u01a1ng v&agrave; 2 n\\u0103m v\\u1ec1 ch\\u1ea5t li\\u1ec7u b\\u1ec1 m\\u1eb7t v\\u1ea3i n\\u1ec9.<br \\/>\\r\\nSofa 3 b\\u0103ng A1305 g&oacute;c tr&aacute;i:<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">3 b\\u0103ng g&oacute;c ph\\u1ea3i:<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">data:image\\/gif;base64,R0lGODdhAQABAPAAAP\\/\\/\\/<br \\/>\\r\\nSofa 3 b\\u0103ng g&oacute;c ph\\u1ea3i A1305<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">\\u0110\\u1eb7c bi\\u1ec7t: To&agrave;n b\\u1ed9 sofa n\\u1ec9 c&oacute; th\\u1ec3 th&aacute;o ra to&agrave;n b\\u1ed9 t\\u1eeb ph\\u1ea7n l\\u01b0ng, ph\\u1ea7n l\\u1eadt, ph\\u1ea7n s\\u01b0\\u1eddn, ph\\u1ea7n tay t\\u1ee9c l&agrave; c&oacute; th\\u1ec3 th&aacute;o r\\u1eddi to&agrave;n b\\u1ed9 ph\\u1ea7n v\\u1ecf v\\u1ea3i n\\u1ec9 c\\u1ee7a sofa nh\\u01b0 m\\u1ed9t c&aacute;i &aacute;o \\u0111\\u1ec3 d\\u1ec5 d&agrave;ng v\\u1ec7 sinh s\\u1ea3n ph\\u1ea9m. Qu&yacute; kh&aacute;ch c&oacute; th\\u1ec3 mua nhi\\u1ec1u v\\u1ecf &aacute;o v\\u1edbi nhi\\u1ec1u m&agrave;u kh&aacute;c nhau \\u0111\\u1ec3 thay \\u0111\\u1ed5i phong c&aacute;ch trong t&iacute;ch t\\u1eafc (\\u01afu \\u0111i\\u1ec3m tuy\\u1ec7t \\u0111\\u1ed1i ch\\u1ec9 c&oacute; sofa n\\u1ec9 nh\\u1eadp kh\\u1ea9u m\\u1edbi c&oacute;).<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">C&aacute;c m\\u1eabu sofa v\\u1ea3i c\\u1ee7a ch&uacute;ng t&ocirc;i \\u0111\\u01b0\\u1ee3c thi\\u1ebft k\\u1ebf ch\\u1ecdn l\\u1ecdc, tinh x\\u1ea3o v\\u1ec1 \\u0111\\u01b0\\u1eddng may v&agrave; \\u0111\\u01b0\\u1eddng n&eacute;t \\u0111\\u01b0\\u1ee3c t\\u1ea1o ra b\\u1edfi c&aacute;c th\\u1ee3 l&agrave;nh ngh\\u1ec1, ph&ugrave; h\\u1ee3p v\\u1edbi c&aacute;c kh&ocirc;ng gian ph&ograve;ng kh&aacute;ch hi\\u1ec7n \\u0111\\u1ea1i mang \\u0111\\u1ebfn kh&ocirc;ng gian sang tr\\u1ecdng, hi\\u1ec7n \\u0111\\u1ea1i cho ng&ocirc;i nh&agrave; kh&aacute;ch h&agrave;ng.<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">L\\u01b0u &yacute;:<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">C&aacute;c m\\u1eabu sofa v\\u1ea3i c&oacute; th\\u1ec3 \\u0111\\u1eb7t s\\u1ea3n xu\\u1ea5t \\u0111\\u1ec3 thay \\u0111\\u1ed5i m&agrave;u s\\u1eafc v\\u1ea3i, chi\\u1ec1u g&oacute;c theo y&ecirc;u c\\u1ea7u \\u0111\\u1ec3 \\u0111&aacute;p \\u1ee9ng t\\u1ed1i \\u0111a nhu c\\u1ea7u c\\u1ee7a kh&aacute;ch h&agrave;ng.<br \\/>\\r\\nS\\u1ea3n ph\\u1ea9m \\u0111&atilde; bao g\\u1ed3m to&agrave;n b\\u1ed9 g\\u1ed1i trang tr&iacute; \\u0111i k&egrave;m.<br \\/>\\r\\nN\\u1ed9i th\\u1ea5t Gia Kh&aacute;nh l&agrave; \\u0111\\u01a1n v\\u1ecb h&agrave;ng \\u0111\\u1ea7u v\\u1ec1 n\\u1ed9i th\\u1ea5t ngo\\u1ea1i nh\\u1eadp cao c\\u1ea5p, v\\u1edbi \\u0111a d\\u1ea1ng ki\\u1ec3u d&aacute;ng, ch\\u1ee7ng lo\\u1ea1i, m&agrave;u s\\u1eafc v&agrave; phong c&aacute;ch kh&aacute;c nhau. V\\u1edbi ph\\u01b0\\u01a1ng ch&acirc;m &ldquo;Uy t&iacute;n l&agrave;m \\u0111\\u1ea7u&rdquo; N\\u1ed9i Th\\u1ea5t Gia Kh&aacute;nh \\u0111&atilde; c&oacute; \\u0111\\u01b0\\u1ee3c l&ograve;ng tin v&agrave; s\\u1ef1 t&iacute;n nhi\\u1ec7m c\\u1ee7a kh&aacute;ch h&agrave;ng, tr\\u1edf th&agrave;nh m\\u1ed9t trong nh\\u1eefng th\\u01b0\\u01a1ng hi\\u1ec7u n\\u1ed9i th\\u1ea5t n\\u1ed5i ti\\u1ebfng t\\u1ea1i Vi\\u1ec7t Nam v\\u1edbi c&aacute;c s\\u1ea3n ph\\u1ea9m nh\\u01b0: b&agrave;n tr&agrave;, b\\u1ed9 b&agrave;n \\u0103n, sofa da, sofa v\\u1ea3i, gi\\u01b0\\u1eddng tr\\u1ebb em, ph&ograve;ng ng\\u1ee7 \\u0111\\u1ed3ng b\\u1ed9&hellip;<\\/span><\\/p>\\r\\n\",\"name\":\"Chi ti\\u1ebft s\\u1ea3n ph\\u1ea9m\",\"type\":\"textarea\",\"sort\":\"\"},{\"content\":\"\",\"name\":\"th\\u00f4ng s\\u1ed1 k\\u1ef9 thu\\u1eadt\",\"type\":\"textarea\",\"sort\":\"2\"},{\"content\":\"\",\"name\":\"H\\u01b0\\u1edbng d\\u1eabn mua h\\u00e0ng\",\"type\":\"int\",\"sort\":\"3\"}]', '', NULL, NULL);
