INSERT INTO `product` (`id`, `style`, `id_value`, `brand`, `name`, `code`, `alias`, `image`, `hot`, `home`, `focus`, `coupon`, `view`, `active`, `price`, `price_sale`, `description`, `description_seo`, `location`, `title_seo`, `keyword_seo`, `detail`, `note`, `like`, `order`, `category_id`, `caption_1`, `caption_2`, `locale`, `bought`, `dksudung`, `sort`, `quantity`, `counter`, `lang`, `destination`, `time`, `tags`, `pro_dir`, `multi_image`, `img_dir`, `status`, `quaranty`, `tinhtrang`, `group_attribute_id`, `color`, `size`, `user_id`, `option_id`, `button_color1`, `config_pro`, `config_pro_content`, `weight`, `price_imp`) VALUES ('16', NULL, NULL, NULL, 'TỦ ÁO 2 CÁNH HIỆN ĐẠI PHONG CÁCH HÀN QUỐC A689D2', NULL, 'tu-ao-2-canh-hien-dai-phong-cach-han-quoc-a689d2', 'a51.jpg', NULL, NULL, NULL, NULL, NULL, '1', NULL, '7000000', '<p>TH&Ocirc;NG SỐ KỸ THUẬT CƠ BẢN CỦA SẢN PHẨM:</p>\r\n\r\n<p>Sản phẩm thuộc d&ograve;ng h&agrave;ng JINDIAN, phong c&aacute;ch H&agrave;n Quốc<br />\r\nSản phẩm được l&agrave;m từ gỗ MFC đ&atilde; qua xử l&yacute; chống cong v&ecirc;nh mối mọt<br />\r\nPhụ kiện theo ti&ecirc;u chuẩn Ch&acirc;u &Acirc;u.<br />\r\nBề mặt sản phẩm được sơn Lacker 7 lớp (lớp sơn d&agrave;y, đẹp, chống trầy xước như c&ocirc;ng nghệ sơn &ocirc;t&ocirc;, đặc trưng của sơn nội thất H&agrave;n Quốc) đạt c&aacute;c ti&ecirc;u chuẩn quốc tế về an to&agrave;n v&agrave; th&acirc;n thiện với người sử dụng.<br />\r\nSản phẩm mang t&iacute;nh thẩm mỹ cao, được đầu tư thiết kế tinh xảo, c&oacute; kết cấu chắc chắn.<br />\r\nBảo h&agrave;nh 2 năm, bảo tr&igrave; suốt qu&atilde;ng đời sản phẩm</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '1', NULL, NULL, NULL, '0', NULL, NULL, '0', '0', 'vi', NULL, NULL, NULL, '17032018', NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, '2', NULL, '0', '[{\"content\":\"<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">TH&Ocirc;NG S\\u1ed0 K\\u1ef8 THU\\u1eacT C\\u01a0 B\\u1ea2N C\\u1ee6A S\\u1ea2N PH\\u1ea8M:<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">S\\u1ea3n ph\\u1ea9m thu\\u1ed9c d&ograve;ng h&agrave;ng JINDIAN, phong c&aacute;ch H&agrave;n Qu\\u1ed1c<br \\/>\\r\\nS\\u1ea3n ph\\u1ea9m \\u0111\\u01b0\\u1ee3c l&agrave;m t\\u1eeb g\\u1ed7 MFC \\u0111&atilde; qua x\\u1eed l&yacute; ch\\u1ed1ng cong v&ecirc;nh m\\u1ed1i m\\u1ecdt<br \\/>\\r\\nPh\\u1ee5 ki\\u1ec7n theo ti&ecirc;u chu\\u1ea9n Ch&acirc;u &Acirc;u.<br \\/>\\r\\nB\\u1ec1 m\\u1eb7t s\\u1ea3n ph\\u1ea9m \\u0111\\u01b0\\u1ee3c s\\u01a1n Lacker 7 l\\u1edbp (l\\u1edbp s\\u01a1n d&agrave;y, \\u0111\\u1eb9p, ch\\u1ed1ng tr\\u1ea7y x\\u01b0\\u1edbc nh\\u01b0 c&ocirc;ng ngh\\u1ec7 s\\u01a1n &ocirc;t&ocirc;, \\u0111\\u1eb7c tr\\u01b0ng c\\u1ee7a s\\u01a1n n\\u1ed9i th\\u1ea5t H&agrave;n Qu\\u1ed1c) \\u0111\\u1ea1t c&aacute;c ti&ecirc;u chu\\u1ea9n qu\\u1ed1c t\\u1ebf v\\u1ec1 an to&agrave;n v&agrave; th&acirc;n thi\\u1ec7n v\\u1edbi ng\\u01b0\\u1eddi s\\u1eed d\\u1ee5ng.<br \\/>\\r\\nS\\u1ea3n ph\\u1ea9m mang t&iacute;nh th\\u1ea9m m\\u1ef9 cao, \\u0111\\u01b0\\u1ee3c \\u0111\\u1ea7u t\\u01b0 thi\\u1ebft k\\u1ebf tinh x\\u1ea3o, c&oacute; k\\u1ebft c\\u1ea5u ch\\u1eafc ch\\u1eafn.<br \\/>\\r\\nB\\u1ea3o h&agrave;nh 2 n\\u0103m, b\\u1ea3o tr&igrave; su\\u1ed1t qu&atilde;ng \\u0111\\u1eddi s\\u1ea3n ph\\u1ea9m<\\/span><\\/p>\\r\\n\",\"name\":\"Chi ti\\u1ebft s\\u1ea3n ph\\u1ea9m\",\"type\":\"textarea\",\"sort\":\"\"},{\"content\":\"\",\"name\":\"th\\u00f4ng s\\u1ed1 k\\u1ef9 thu\\u1eadt\",\"type\":\"textarea\",\"sort\":\"2\"},{\"content\":\"\",\"name\":\"H\\u01b0\\u1edbng d\\u1eabn mua h\\u00e0ng\",\"type\":\"int\",\"sort\":\"3\"}]', '', NULL, NULL);
