cf cao c\\u1ea5p, qu&yacute; hi\\u1ebfm, s\\u01a1n b&oacute;ng.<br \\/>\\r\\nB\\u1ea3o h&agrave;nh: 2 n\\u0103m, b\\u1ea3o tr&igrave; su\\u1ed1t qu&atilde;ng \\u0111\\u1eddi s\\u1ea3n ph\\u1ea9m<br \\/>\\r\\nXu\\u1ea5t x\\u1ee9: Nh\\u1eadp kh\\u1ea9u<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">T\\u1ea5t c\\u1ea3 c&aacute;c s\\u1ea3n ph\\u1ea9m trong d&ograve;ng h&agrave;ng French William \\u0111\\u1ec1u \\u0111\\u1ed3ng b\\u1ed9 v\\u1ec1 phong c&aacute;ch, n\\u01b0\\u1edbc s\\u01a1n. N&ecirc;n c&oacute; th\\u1ec3 d&ugrave;ng chung c&aacute;c m&atilde; h&agrave;ng \\u0111\\u01a1n l\\u1ebb \\u0111\\u1ec3 k\\u1ebft h\\u1ee3p th&agrave;nh \\u0111\\u1ed3ng b\\u1ed9 sao cho ph&ugrave; h\\u1ee3p v\\u1edbi kh&ocirc;ng gian n\\u1ed9i th\\u1ea5t.<\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify\\\"><span style=\\\"font-size:14px\\\">TH&Ocirc;NG TIN S\\u1ea2N PH\\u1ea8M:<\\/span><\\/p>\\r\\n\",\"name\":\"Chi ti\\u1ebft s\\u1ea3n ph\\u1ea9m\",\"type\":\"textarea\",\"sort\":\"\"},{\"content\":\"\",\"name\":\"th\\u00f4ng s\\u1ed1 k\\u1ef9 thu\\u1eadt\",\"type\":\"textarea\",\"sort\":\"2\"},{\"content\":\"\",\"name\":\"H\\u01b0\\u1edbng d\\u1eabn mua h\\u00e0ng\",\"type\":\"int\",\"sort\":\"3\"}]', '', NULL, NULL);
