1ed5 \\u0111i\\u1ec3n<br \\/>\\r\\nK&iacute;ch th\\u01b0\\u1edbc: 600&times;410&times;550<br \\/>\\r\\nM&atilde; SP: KH3007B<br \\/>\\r\\nXu\\u1ea5t x\\u1ee9: Nh\\u1eadp kh\\u1ea9u<br \\/>\\r\\nCh\\u1ea5t li\\u1ec7u: Khung g\\u1ed7 S\\u1ed3i OAK cao c\\u1ea5p + MFC, ph\\u1ee5 ki\\u1ec7n m\\u1ea1 v&agrave;ng 24K nh\\u1eadp kh\\u1ea9u Ch&acirc;u &Acirc;u, k\\u1ebft h\\u1ee3p \\u0111&aacute; H\\u1ed3ng Ng\\u1ecdc t\\u1ef1 nhi&ecirc;n<br \\/>\\r\\nB\\u1ea3o h&agrave;nh: 2 n\\u0103m, b\\u1ea3o tr&igrave; su\\u1ed1t qu&atilde;ng \\u0111\\u1eddi s\\u1ea3n ph\\u1ea9m<\\/span><\\/p>\\r\\n\",\"name\":\"Chi ti\\u1ebft s\\u1ea3n ph\\u1ea9m\",\"type\":\"textarea\",\"sort\":\"\"},{\"content\":\"\",\"name\":\"th\\u00f4ng s\\u1ed1 k\\u1ef9 thu\\u1eadt\",\"type\":\"textarea\",\"sort\":\"2\"},{\"content\":\"\",\"name\":\"H\\u01b0\\u1edbng d\\u1eabn mua h\\u00e0ng\",\"type\":\"int\",\"sort\":\"3\"}]', '', NULL, NULL);
