INSERT INTO `staticpage` (`id`, `name`, `alias`, `description`, `content`, `image`, `lang`, `home`, `hot`, `focus`, `contact_page`, `title_seo`, `keyword_seo`, `description_seo`, `parent_id`, `page_footer`) VALUES ('31', 'Giới Thiệu', 'gioi-thieu', '<p>C&Ocirc;NG TY TNHH DỊCH VỤ BẢO VỆ LONG PHỤNG HO&Agrave;NG</p>\r\n\r\n<p>Địa chỉ: B2-18&nbsp;Đường Gi&aacute;p Hải, Phường Xương Giang, TP Bắc Giang<br />\r\nSố&nbsp;ĐT: 0983.386.281 - 0916.51.51.82<br />\r\nEmail: lphanvantien.dichvuanninhlph@gmail.com - Website:&nbsp;http://baovelongphunghoang.com/<br />\r\nM&atilde; số thuế: 2400790363<br />\r\nNgười đại diện: &Ocirc;ng Phan Văn Tiến Lục&nbsp;- Chức vụ: Gi&aacute;m đốc</p>\r\n', '<p>Ch&uacute;ng t&ocirc;i cam kết mang lại cho qu&yacute; kh&aacute;ch chất lượng&nbsp;<a href=\"http://anninhnhat.com/dich-vu-bao-ve/\">dịch vụ bảo vệ</a>&nbsp;tốt nhất với gi&aacute; cả cạnh tranh. Ch&uacute;ng t&ocirc;i c&oacute; kinh nghiệm trong việc xử l&yacute; c&aacute;c vấn đề ph&aacute;t sinh, v&agrave; giải quyết mọi y&ecirc;u cầu của qu&yacute; kh&aacute;ch. Tất cả c&aacute;c vấn đề nội bộ sẽ được xử l&yacute; bảo mật tuyệt đối v&agrave; chuy&ecirc;n nghiệp nhất. Nh&acirc;n vi&ecirc;n bảo vệ của ch&uacute;ng t&ocirc;i sẽ đem lại cho c&ocirc;ng ty của qu&yacute; kh&aacute;ch sự y&ecirc;n t&acirc;m v&agrave; tin cậy trong một m&ocirc;i trường kh&ocirc;ng c&oacute; tội phạm v&agrave; bạo lực. D&ugrave; nhu cầu về an ninh của qu&yacute; kh&aacute;ch như thế n&agrave;o, dịch vụ bảo vệ&nbsp;lu&ocirc;n c&oacute; giải một giải ph&aacute;p th&iacute;ch hợp .</p>\r\n\r\n<p>C&Ocirc;NG TY TNHH DỊCH VỤ BẢO VỆ LONG PHỤNG HO&Agrave;NG</p>\r\n\r\n<p>Địa chỉ: B2-18&nbsp;Đường Gi&aacute;p Hải, Phường Xương Giang, TP Bắc Giang<br />\r\nSố&nbsp;ĐT: 0983.386.281 - 0916.51.51.82<br />\r\nEmail: lphanvantien.dichvuanninhlph@gmail.com - Website:&nbsp;http://baovelongphunghoang.com/<br />\r\nM&atilde; số thuế: 2400790363<br />\r\nNgười đại diện: &Ocirc;ng Phan Văn Tiến Lục&nbsp;- Chức vụ: Gi&aacute;m đốc</p>\r\n', 'upload/img/pages/1.jpg', 'vi', '0', '1', '1', '0', '', '', '', '0', '1');
INSERT INTO `staticpage` (`id`, `name`, `alias`, `description`, `content`, `image`, `lang`, `home`, `hot`, `focus`, `contact_page`, `title_seo`, `keyword_seo`, `description_seo`, `parent_id`, `page_footer`) VALUES ('38', 'CÔNG TY CỔ PHẦN XÂY DỰNG TUẤN PHÁT', 'cong-ty-co-phan-xay-dung-tuan-phat', '<p>D&ugrave; căn hộ của bạn c&oacute; ở nơi đ&acirc;u, ch&uacute;ng t&ocirc;i cũng cử kiến tr&uacute;c sư tới tư vấn, đo đạc, thiết kế căn hộ đẹp nhất cho bạn. Sau Thiết Kế nếu c&aacute;c bạn cảm thấy ưng c&aacute;c sản phẩm do ch&uacute;ng t&ocirc;i sản xuất, ch&uacute;ng t&ocirc;i sẽ sản xuất, thi c&ocirc;ng lắp đặt trọn gọi c&ocirc;ng tr&igrave;nh nội thất cho gia đ&igrave;nh bạn. Ch&uacute;ng t&ocirc;i tự h&agrave;o l&agrave; một trong số &iacute;t c&aacute;c c&ocirc;ng ty đầu ti&ecirc;n trong ng&agrave;nh nội thất tại H&agrave; Nội. Với c&ocirc;ng nghệ v&agrave; m&aacute;y m&oacute;c hiện đại ch&uacute;ng t&ocirc;i c&oacute; thể đ&aacute;p ứng mọi y&ecirc;u cầu khắt khe nhất về nội thất của kh&aacute;ch h&agrave;ng</p>\r\n', '', 'upload/img/pages/page.png', 'vi', '1', NULL, NULL, '0', '', '', '', '0', '0');
